import React, { useState } from 'react';
import './App.css';
import { Login } from './components/login';
import { Register } from './components/register';

function App() {
  const [currentFrom, setCurrentFrom] = useState("login");
  return (
    <div className="App">
     {
     currentFrom === "login" ? <Login/> : <Register/>
     }
    </div>
  );
}

export default App;
